 `retorno` date ,
 `crono_date` date ,
 `project_id` bigint(11) 
)*/;

/*View structure for view moderna_objectshistories */

/*!50001 DROP TABLE IF EXISTS `moderna_objectshistories` */;
/*!50001 DROP VIEW IF EXISTS `moderna_objectshistories` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `moderna_objectshistories` AS select `mt`.`id` AS `id`,`mt`.`object_id` AS `object_id`,`mt`.`userInfo_id` AS `userInfo_id`,`mt`.`status_id` AS `status_id`,`mt`.`crono_date` AS `crono_date`,`mt`.`topic` AS `topic`,`mt`.`description` AS `description`,`mt`.`task_to` AS `task_to`,`mt`.`created_at` AS `created_at`,'prova' AS `prova`,'tasks' AS `type` from `moderna_tasks` `mt` where (`mt`.`task_id` = '0') union select `mos`.`id` AS `id`,`mos`.`object_id` AS `object_id`,`mos`.`userInfo_id` AS `userInfo_id`,`mos`.`status_id` AS `status_id`,`mos`.`crono_date` AS `crono_date`,`mos`.`id` AS `topic`,`mos`.`description` AS `description`,'0' AS `task_to`,`mos`.`created_at` AS `created_at`,`mos`.`prova` AS `prova`,'status' AS `type` from `moderna_objects_status` `mos` */;

/*View structure for view moderna_objectstatus */

/*!50001 DROP TABLE IF EXISTS `moderna_objectstatus` */;
/*!50001 DROP VIEW IF EXISTS `moderna_objectstatus` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `moderna_objectstatus` AS (select `obj`.`id` AS `id`,`obj`.`title` AS `title`,`obj`.`taxonomia` AS `taxonomia`,`obj`.`typeobject_id` AS `typeobject_id`,(select `to`.`name` from `moderna_typeobjects` `to` where (`to`.`id` = `obj`.`typeobject_id`) limit 1) AS `typeobject_name`,`obj`.`collection_id` AS `collection_id`,(select `mat`.`name` from `moderna_collections` `mat` where (`mat`.`id` = `obj`.`collection_id`) limit 1) AS `collection_name`,`obj`.`anotacoes` AS `anotacoes`,(select `mat`.`materia_id` from `moderna_collections` `mat` where (`mat`.`id` = `obj`.`collection_id`) limit 1) AS `materia_id`,(select `mat`.`name` from `moderna_materias` `mat` where (`mat`.`id` = `materia_id`) limit 1) AS `materia_name`,`obj`.`supplier_id` AS `supplier_id`,(select `ms`.`empresa` from `moderna_suppliers` `ms` where (`ms`.`id` = `obj`.`supplier_id`) limit 1) AS `supplier_empresa`,`obj`.`fase` AS `fase`,`obj`.`interatividade` AS `interatividade`,`obj`.`reaproveitamento` AS `reaproveitamento`,(select `mos`.`status_id` from `moderna_objects_status` `mos` where (`mos`.`object_id` = `obj`.`id`) order by `mos`.`id` desc limit 1) AS `status_id`,(select `mos`.`status` from `moderna_status` `mos` where (`mos`.`id` = `status_id`) limit 1) AS `statu_status`,(select `mos`.`class` from `moderna_status` `mos` where (`mos`.`id` = `status_id`) limit 1) AS `statu_class`,(select `mos`.`prova` from `moderna_objects_status` `mos` where (`mos`.`object_id` = `obj`.`id`) order by `mos`.`id` desc limit 1) AS `prova`,(select `mos`.`crono_date` from `moderna_objects_status` `mos` where (`mos`.`object_id` = `obj`.`id`) order by `mos`.`id` desc limit 1) AS `retorno`,`obj`.`crono_date` AS `crono_date`,(select `cp`.`project_id` from `moderna_collections_projects` `cp` where (`cp`.`collection_id` = `obj`.`collection_id`) limit 1) AS `project_id` from `moderna_objects` `obj`) */;

